import React from "react";
import { makeStyles } from "@material-ui/core/styles";
import Card from "@material-ui/core/Card";
import CardContent from "@material-ui/core/CardContent";
import CardMedia from "@material-ui/core/CardMedia";
import Typography from "@material-ui/core/Typography";
import Chip from "@material-ui/core/Chip";
import FavoriteIcon from "@material-ui/icons/Favorite";
import Grid from "@material-ui/core/Grid";
import Box from "@material-ui/core/Box";
import hospImg from "../../img/results/pantaihospital.png";

const useStyles = makeStyles((theme) => ({
  root: {
    display: "flex",
    margin: 30,
  },
  details: {
    display: "flex",
    flexDirection: "row",
  },
  cover: {
    width: "70%",
    marginTop: 80,
    marginBottom: 20,
  },
}));

//This card is imported in SearchResult.js

// Each indiivdual doctor card
export default function DocCard() {
  const classes = useStyles();

  return (
    <Card className={classes.root}>
      <div className={classes.details}>
        <Grid container spacing={0}>
          <Grid item md={3}>
            <Box
              display="flex"
              flexDirection="column"
              justifyContent="center"
              alignItems="center"
              ml={2}
              mr={2}
            >
              {/* hospital logo image */}
              <CardMedia
                component="img"
                className={classes.cover}
                image={hospImg}
              ></CardMedia>
            </Box>
          </Grid>
          <Grid item md={7}>
            <CardContent>
              {/* hospital details */}
              <Typography variant="h6" color="primary">
                Pantai Hospital Kuala Lumpur
              </Typography>
              <br></br>
              <Typography variant="subtitle1" color="textSecondary">
                <strong>Address: </strong>
                <span>
                  Block 8, Jalan Bukit Pantai, Bangsar, 59100 Kuala Lumpur,
                  Wilayah Persekutuan Kuala Lumpur
                </span>
              </Typography>
              <Typography variant="subtitle1" color="textSecondary">
                <strong>Phone: </strong>
                <span>+603-22960888</span>
              </Typography>

              <br></br>
              <Chip color="secondary" size="small" label="Private"></Chip>
            </CardContent>
          </Grid>
          <Grid item md={2}>
            {/* like icon + number of likes */}
            <Box
              mt={3}
              mr={1}
              display="flex"
              flexDirection="column"
              justifyContent="center"
              alignItems="center"
            >
              <FavoriteIcon color="secondary" />
              <Typography variant="body2" color="primary">
                1234
              </Typography>
            </Box>
          </Grid>
        </Grid>
      </div>
    </Card>
  );
}
